const e=JSON.parse('{"key":"v-73eeb90b","path":"/zh/language/Java/basics/generic/23.generic.html","title":"泛型","lang":"zh-CN","frontmatter":{"category":["Java 泛型"],"description":"泛型 为什么C++泛型支持int等基本类型而Java泛型不支持呢？ 泛型在Java中是一个非常重要的语法，比如我们经常用的容器都支持泛型。Java泛型不支持int等基本类型，所以，在Java容器中不能存储基本类型数据，比如List&lt;int&gt;这样是不合法的。而C++泛型支持int等基本类型，所以，在C++容器中可以存储基本类型数据，比如vector&lt;int&gt;这样是合法的。那么，为什么C++泛型支持int等基本类型而Java泛型不支持呢？带着这个问题，我们来学习本节的内容。","head":[["meta",{"property":"og:url","content":"https://theme-zhang.netlify.app/zh/language/Java/basics/generic/23.generic.html"}],["meta",{"property":"og:site_name","content":"zhang"}],["meta",{"property":"og:title","content":"泛型"}],["meta",{"property":"og:description","content":"泛型 为什么C++泛型支持int等基本类型而Java泛型不支持呢？ 泛型在Java中是一个非常重要的语法，比如我们经常用的容器都支持泛型。Java泛型不支持int等基本类型，所以，在Java容器中不能存储基本类型数据，比如List&lt;int&gt;这样是不合法的。而C++泛型支持int等基本类型，所以，在C++容器中可以存储基本类型数据，比如vector&lt;int&gt;这样是合法的。那么，为什么C++泛型支持int等基本类型而Java泛型不支持呢？带着这个问题，我们来学习本节的内容。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:updated_time","content":"2022-12-09T06:04:07.000Z"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:locale:alternate","content":"en-US"}],["meta",{"property":"article:modified_time","content":"2022-12-09T06:04:07.000Z"}],["link",{"rel":"alternate","hreflang":"en-us","href":"https://theme-zhang.netlify.app/en/language/Java/basics/generic/23.generic.html"}]]},"headers":[{"level":2,"title":"一、为什么使用泛型","slug":"一、为什么使用泛型","link":"#一、为什么使用泛型","children":[]},{"level":2,"title":"二、泛型的基本用法","slug":"二、泛型的基本用法","link":"#二、泛型的基本用法","children":[]},{"level":2,"title":"三、泛型中的通配符","slug":"三、泛型中的通配符","link":"#三、泛型中的通配符","children":[]},{"level":2,"title":"四、泛型的类型擦除","slug":"四、泛型的类型擦除","link":"#四、泛型的类型擦除","children":[]},{"level":2,"title":"五、课后思考题","slug":"五、课后思考题","link":"#五、课后思考题","children":[]}],"git":{"createdTime":1670565847000,"updatedTime":1670565847000,"contributors":[{"name":"zhanglf","email":"454486214@qq.com","commits":1}]},"readingTime":{"minutes":15,"words":4499},"filePathRelative":"zh/language/Java/basics/generic/23.generic.md","localizedDate":"2022年12月9日","excerpt":"<h1> 泛型</h1>\\n<blockquote>\\n<p><strong>为什么C++泛型支持int等基本类型而Java泛型不支持呢？</strong></p>\\n</blockquote>\\n<p>泛型在Java中是一个非常重要的语法，比如我们经常用的容器都支持泛型。Java泛型不支持int等基本类型，所以，在Java容器中不能存储基本类型数据，比如<code>List&lt;int&gt;</code>这样是不合法的。而C++泛型支持int等基本类型，所以，在C++容器中可以存储基本类型数据，比如<code>vector&lt;int&gt;</code>这样是合法的。那么，为什么C++泛型支持int等基本类型而Java泛型不支持呢？带着这个问题，我们来学习本节的内容。</p>","autoDesc":true}');export{e as data};
